import React from "react";

function Card({ mealName, imgSrc }) {
  return (
    <div className="card-wrapper">
      <img src={imgSrc} className="card-image" />
      <div className="card-body">
        <h3>{mealName}</h3>
      </div>
    </div>
  );
}

export default Card;
